window.bookSummaryJSON = "<p>A curse to break. A sister to find. A quadrant to reclaim.</p> <p>After the initial shock of being soul seared to a stranger, Creed and I realize the universe might know what it's doing after all. As the two realms unite and initial relationships are made, the news of our mating breeds more than salacious curiosity throughout Dornte—it ignites hope.</p> <p>The citizens want safety, freedom, and the restoration of the royal family.</p> <p>With the rule of the usurper queen threatened, Laryssa's claws come out, and her most effective weapons against Creed are threatening my life, tormenting his sister, and empowering the blood witch to torture him with the dark beast he's been cursed with.</p> <p>But Creed isn't alone in his fight anymore. Now, he has us.</p> <p><i>Dark Soul</i> is book two in the second harem of the Guardians of the Fae Realms, steamy reverse harem paranormal romance series. Expect sexy polyamorous situations (mmmfm), rollicking action, ongoing storylines, and shifter lovers who find what they need from not only their queen, but each other as well. Med-burn, med angst, vivid sexual content, and language.</p>"; 
